\u901f\u5ea6\u4e0a\u5347\uff0c\u6bd4\u8f03\u5317\u908a\u7684\u570b\u5bb6\uff1a\u97d3\u570b\uff0c1971~2009\u7684\u4e0a\u5347\u901f\u5ea6\u70ba0.0423\u5ea6/\u5e74]]\u003e\u003c/Text\u003e\u003cText\u003e\u003c![CDATA[![koreaYearTemp](./img/koreaYearTemp.png)]]\u003e\u003c/Text\u003e\u003cText\u003e\u003c![CDATA[\u800c\u5176\u4ed6\u8cc7\u8a0a\u53ef\u4ee5\u5230\u4e0a\u9762\u7684\u5716\u8868\u67e5\u8a62\uff0c\u9ede\u64ca\u53f3\u908a\u7684\u5b57\uff0c\u8a72\u8cc7\u8a0a\u5c31\u6703\u96b1\u85cf\u6216\u986f\u793a\uff0c\u96d9\u64ca\u5c31\u662f\u5168\u90e8\u986f\u793a\u6216\u9664\u4e86\u9ede\u64ca\u5230\u7684\u7559\u4e0b\u5176\u4ed6\u5168\u90e8\u96b1\u85cf]]\u003e\u003c/Text\u003e\u003cText\u003e\u003c![CDATA[\u003chr/\u003e]]\u003e\u003c/Text\u003e\u003cText\u003e\u003c![CDATA[\u9084\u8a18\u5f972020\u548c2019\u88ab\u65b0\u805e\u7a31\u70ba\u6696\u51ac\u55ce\uff1f\u5176\u5be6\u5728\u6b64\u4f8b\u5b50\u4e2d\u5b83\u5011\u78ba\u5be6\u5f88\u6696\uff0c\u81f3\u65bc2021\u5462\uff1f\u4f3c\u4e4e\u4e0d\u80fd\u88ab\u7a31\u70ba\u6696\u51ac\uff0c\u4f46\u6696\u51ac\u5230\u5e95\u600e\u9ebc\u5b9a\u7fa9\uff1f]]\u003e\u003c/Text\u003e\u003cText\u003e\u003c![CDATA[### Let\u0027s Define]]\u003e\u003c/Text\u003e\u003cText\u003e\u003c![CDATA[\u5176\u5be6\u5b8c\u5168\u6c92\u6709\u5b9a\u7fa9\uff0c\u79d1\u5b78\u5bb6\u4e26\u6c92\u6709\u70ba\u9019\u500b\u540d\u8a5e\u505a\u5b9a\u7fa9\uff0c\u4e5f\u5c31\u662f\u6211\u4e5f\u4e0d\u77e5\u9053\u6696\u51ac\u5230\u5e95\u4ee3\u8868\u4ec0\u9ebc\uff0c\u9019\u5c31\u50cf\u4eca\u5929\u5929\u6c23\u5f88\u51b7\u4e00\u6a23\uff0c\u51b7\u5230\u5e95\u662f\u591a\u5c11\u5ea6\uff1f\u6709\u4e9b\u4eba\u9019\u6a23\u5b9a\u7fa9\uff1a**\u51b7\u6696\u5e74 = \ufe5d\u8a72\u5e74\u51ac\u5b63\u5e73\u5747\u6eab\u5ea6\ufe5e+\u6216-\ufe5d30\u5e74\u51ac\u5b63\u5e73\u5747\u6c23\u6eab\u6a19\u6e96\u5dee\ufe5e**\uff0c\u65bc\u662f\u6211\u4e5f\u9019\u6a23\u8a66\u8457\u53bb\u5b9a\u7fa9\u4f86\u7522\u751f\u5716\uff0c\u4f46\u6211\u6c92\u670930\u5e74\u7684\u8cc7\u6599\uff0c\u65bc\u662f\u53ea\u63a1\u752828\u5e74\u3002]]\u003e\u003c/Text\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" responsive=\"true\" scale=\"1.0\" src=\"ref://53a17b7b8f\"/\u003e\u003cText\u003e\u003c![CDATA[\u4ee5\u6b64\u5b9a\u7fa9\u4f86\u770b2020\u30012019\u78ba\u5be6\u662f\u6696\u51ac]]\u003e\u003c/Text\u003e\u003cText\u003e\u003c![CDATA[* **Wait a minute, so called \"Warm winter\" is mean the winter in this year is warm. But when news say this winter is a warm winter, the winter didn\u0027t end. So, it is nonsense.**]]\u003e\u003c/Text\u003e\u003cText\u003e\u003c![CDATA[\u770b\u5f97\u61c2\u82f1\u6587\u5c31\u77e5\u9053\u6211\u5728\u8aaa\u4ec0\u9ebc\u4e86\uff0c\u9019\u662f\u6211\u5728\u8cc7\u6599\u641c\u5c0b\u3001\u601d\u8003\u6642\uff0c\u767c\u73fe\u4e00\u500b\u91cd\u8981\u5f0a\u7aef\u800c\u812b\u53e3\u800c\u51fa\u7684\u82f1\u6587\uff1a\u65b0\u805e\u8aaa\u7684\u51b7\u6696\u51ac\u5f80\u5f80\u90fd\u662f\u5728\u51ac\u5929\u9084\u672a\u7d50\u675f\u6642\u5ba3\u5e03\u7684\uff0c\u4f46\u9019\u5f80\u5f80\u4e0d\u662f\u5c08\u696d\u7d71\u8a08\u4eba\u54e1\u6240\u6703\u8aaa\u7684\u8a71\uff0c\u56e0\u70ba\u8981\u5b9a\u7fa9\u4e00\u6bb5\u6642\u9593\u7684\u6c23\u5019\u73fe\u8c61\uff0c\u5f80\u5f80\u8981\u7b49\u5230\u8a72\u6bb5\u6642\u9593\u7d50\u675f\uff0c\u5b8c\u6210\u7d71\u8a08\uff0c\u624d\u80fd\u7a31\u8a72\u5e74\u51ac\u5b63\u70ba\u51b7\u6696\u51ac\uff0c\u4f46\u5be6\u969b\u4e0a\u65b0\u805e\u4e26\u4e0d\u662f\u9019\u6a23\u7684\u3002]]\u003e\u003c/Text\u003e\u003cText\u003e\u003c![CDATA[## \u7e3d\u7d50]]\u003e\u003c/Text\u003e\u003cText\u003e\u003c![CDATA[\u505a\u5230\u5f8c\u9762\u5176\u5be6\u5df2\u7d93\u6709\u9ede\u75b2\u4e4f\uff0c\u96a8\u8457\u6696\u51ac\u7684\u5b9a\u7fa9\u8d8a\u4f86\u8d8a\u6a21\u7cca\uff0c\u9019\u500b\u7d71\u8a08\u8cc7\u6599\u4e5f\u8d8a\u4e0d\u91cd\u8981\uff0c\u6c23\u5019\u539f\u672c\u5c31\u591a\u5c11\u6703\u4e0d\u592a\u6e96\u78ba\uff0c\u53d7\u5230\u5f88\u591a\u56e0\u7d20\u5f71\u97ff\u3002\n\u7e3d\u7684\u4f86\u8aaa\uff0c\u53f0\u7063\u7684\u6975\u7aef\u6c23\u5019\u4e0d\u592a\u660e\u986f\uff0
